  [],\n\t\"revision_timestamp\": \"2016-10-15T16:36:09.461431\",\n\t\"name\": \"mason-neck-national-wildlife-refuge-annual-narrative-report-calendar-year-1976\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This annual narrative report for Mason
  Neck National Wildlife Refuge outlines Refuge accomplishments during the 1976 calendar
  year. The report begins with an introduction to the Refuge and information about
  climate conditions, habitat conditions, land acquisition, and system status. Refuge
  maintenance and wildfires are also described. Habitat management is covered; wetlands
  and forestlands are discussed. The wildlife section of the report discusses endangered
  and threatened species, migratory birds, big game animals, and raptors. Interpretation
  and recreation activities are outlined; topics include information and interpretation,
  recreation, and law enforcement. Field investigations, cooperative programs, items
  of interest, and safety are discussed.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
